    data: |
      SELECT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( + col0 ) NOT IN ( - 78 * - 55 * + col0 * col2 - + col2, - col2 + col0 );
  - name: tab0

outputs:
  - name: q1732.out
    data: |
      10
      47
      99
